import { BackendHomeStyled } from './BackendHome.styled';
import SideBar from '../SideBar/SideBar';
import NavBar from '../NavBar/NavBar';

const BackendHome = () => {
	return (
		<>
		<NavBar />
	<BackendHomeStyled>
			<SideBar />
			<div style={{ backgroundColor: 'blue' }} />
		</BackendHomeStyled>
		</>
	);
};

export default BackendHome;
